import { h } from 'preact';
import {
    isEmpty,
    map,
    pipe,
    reject,
    split,
    trim
} from 'lodash/fp';

import styles from './article.css';

const renderTags = pipe(
    split(','),
    map(trim),
    reject(isEmpty),
    map((tag) => <li className={styles.tag}>{tag}</li>)
);

export default function Article({ body_html, title, tag_list }) {
    return <article className={styles.root}>
        <header>
            <h2 className={styles.title}>{title}</h2>
            <nav className={styles.tagsContainer}>
                <ul className={styles.tags}>
                    {renderTags(tag_list)}
                </ul>
            </nav>
        </header>
        <div className={styles.content} dangerouslySetInnerHTML={{__html: body_html}} />
    </article>;
}

.root {
    font-family: sans-serif;
}

.title {
    margin-left: 1rem;
}

.loader {
    display: block;
    width: calc(100% - 2rem);
    margin: 0 1rem;
}

.tagsContainer {
    display: flex;
    align-items: center;
}

.tags {
    list-style-type: none;
    margin: 0;
    padding: 0;
    display: flex;
}

.tag {
    border: 1px solid black;
    margin-right: 1em;
    padding: 0.5em;
}

.root {
    padding: 1em;
    border: 1px solid gray;
    margin: 1em;
    box-shadow: 0.5em 0.5em 0.5em rgba(0, 0, 0, 0.5);
}

.title {
    margin-top: 0;
}

.content {
    max-height: 10em;
    overflow: hidden;
    position: relative;
}

.content:after {
    content: "";
    position: absolute;
    bottom: 0;
    right: 0;
    left: 0;
    height: 2em;
    background: linear-gradient(180deg, transparent 0%, white 100%);
}

